import React, { useState } from 'react';
import axios from 'axios';

function AddStudentForm() {
  const [formData, setFormData] = useState({
    admissionNumber: '',
    studentName: '',
    gender: '',
    aadharNumber: '',
    rationCardNumber: '',
    fatherName: '',
    fatherOccupation: '',
    motherName: '',
    motherOccupation: '',
    phoneNumber: '',
    caste: '',
    religion: '',
    nationality: '',
    addressCity: '',
    pincode: '',
    guardianName: '',
    guardianAddress: '',
    previousSchoolName: '',
    previousSchoolCity: '',
    previousSchoolState: '',
    classStudiedLast: '',
    yearOfStudy: '',
    tcNumber: '',
    date: '',
    identificationMarks: '',
    agreement: false,
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/add-student', formData);
      console.log('Response:', response.data);
      alert('Student added successfully!');
    } catch (error) {
      console.error('Error adding student:', error);
      alert('Failed to add student. Please try again.');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="admissionNumber"
        value={formData.admissionNumber}
        onChange={handleChange}
        placeholder="Admission Number"
      />
      <input
        type="text"
        name="studentName"
        value={formData.studentName}
        onChange={handleChange}
        placeholder="Student Name"
      />
      <select
        name="gender"
        value={formData.gender}
        onChange={handleChange}
      >
        <option value="">Select Gender</option>
        <option value="male">Male</option>
        <option value="female">Female</option>
        <option value="other">Other</option>
      </select>
      <input
        type="text"
        name="aadharNumber"
        value={formData.aadharNumber}
        onChange={handleChange}
        placeholder="Aadhar Number"
      />
      <input
        type="text"
        name="rationCardNumber"
        value={formData.rationCardNumber}
        onChange={handleChange}
        placeholder="Ration Card Number"
      />
      <input
        type="text"
        name="fatherName"
        value={formData.fatherName}
        onChange={handleChange}
        placeholder="Father's Name"
      />
      <input
        type="text"
        name="fatherOccupation"
        value={formData.fatherOccupation}
        onChange={handleChange}
        placeholder="Father's Occupation"
      />
      <input
        type="text"
        name="motherName"
        value={formData.motherName}
        onChange={handleChange}
        placeholder="Mother's Name"
      />
      <input
        type="text"
        name="motherOccupation"
        value={formData.motherOccupation}
        onChange={handleChange}
        placeholder="Mother's Occupation"
      />
      <input
        type="text"
        name="phoneNumber"
        value={formData.phoneNumber}
        onChange={handleChange}
        placeholder="Phone Number"
      />
      <input
        type="text"
        name="caste"
        value={formData.caste}
        onChange={handleChange}
        placeholder="Caste"
      />
      <input
        type="text"
        name="religion"
        value={formData.religion}
        onChange={handleChange}
        placeholder="Religion"
      />
      <input
        type="text"
        name="nationality"
        value={formData.nationality}
        onChange={handleChange}
        placeholder="Nationality"
      />
      <input
        type="text"
        name="addressCity"
        value={formData.addressCity}
        onChange={handleChange}
        placeholder="City"
      />
      <input
        type="text"
        name="pincode"
        value={formData.pincode}
        onChange={handleChange}
        placeholder="Pincode"
      />
      <input
        type="text"
        name="guardianName"
        value={formData.guardianName}
        onChange={handleChange}
        placeholder="Guardian's Name"
      />
      <input
        type="text"
        name="guardianAddress"
        value={formData.guardianAddress}
        onChange={handleChange}
        placeholder="Guardian's Address"
      />
      <input
        type="text"
        name="previousSchoolName"
        value={formData.previousSchoolName}
        onChange={handleChange}
        placeholder="Previous School Name"
      />
      <input
        type="text"
        name="previousSchoolCity"
        value={formData.previousSchoolCity}
        onChange={handleChange}
        placeholder="Previous School City"
      />
      <input
        type="text"
        name="previousSchoolState"
        value={formData.previousSchoolState}
        onChange={handleChange}
        placeholder="Previous School State"
      />
      <input
        type="text"
        name="classStudiedLast"
        value={formData.classStudiedLast}
        onChange={handleChange}
        placeholder="Class Studied Last"
      />
      <input
        type="text"
        name="yearOfStudy"
        value={formData.yearOfStudy}
        onChange={handleChange}
        placeholder="Year of Study"
      />
      <input
        type="text"
        name="tcNumber"
        value={formData.tcNumber}
        onChange={handleChange}
        placeholder="TC Number"
      />
      <input
        type="date"
        name="date"
        value={formData.date}
        onChange={handleChange}
        placeholder="Date"
      />
      <textarea
        name="identificationMarks"
        value={formData.identificationMarks}
        onChange={handleChange}
        placeholder="Identification Marks"
      ></textarea>
      <label>
        <input
          type="checkbox"
          name="agreement"
          checked={formData.agreement}
          onChange={(e) => setFormData({ ...formData, agreement: e.target.checked })}
        />
        I agree that all the above details are valid.
      </label>
      <button type="submit">Submit</button>
    </form>
  );
}

export default AddStudentForm;
